import { Component, OnInit, OnDestroy } from '@angular/core';
import { HttpErrorResponse, HttpResponse } from '@angular/common/http';
import { Subscription } from 'rxjs';
import { JhiEventManager, JhiAlertService } from 'ng-jhipster';

import { IPartido } from 'app/shared/model/partido.model';
import { Principal } from 'app/core';
import { PartidoService } from './partido.service';

@Component({
    selector: 'jhi-partido',
    templateUrl: './partido.component.html'
})
export class PartidoComponent implements OnInit, OnDestroy {
    partidos: IPartido[];
    currentAccount: any;
    eventSubscriber: Subscription;

    constructor(
        private partidoService: PartidoService,
        private jhiAlertService: JhiAlertService,
        private eventManager: JhiEventManager,
        private principal: Principal
    ) {}

    loadAll() {
        this.partidoService.query().subscribe(
            (res: HttpResponse<IPartido[]>) => {
                this.partidos = res.body;
            },
            (res: HttpErrorResponse) => this.onError(res.message)
        );
    }

    ngOnInit() {
        this.loadAll();
        this.principal.identity().then(account => {
            this.currentAccount = account;
        });
        this.registerChangeInPartidos();
    }

    ngOnDestroy() {
        this.eventManager.destroy(this.eventSubscriber);
    }

    trackId(index: number, item: IPartido) {
        return item.id;
    }

    registerChangeInPartidos() {
        this.eventSubscriber = this.eventManager.subscribe('partidoListModification', response => this.loadAll());
    }

    private onError(errorMessage: string) {
        this.jhiAlertService.error(errorMessage, null, null);
    }
}
